                    Enter location <input name="location" className="form-control" /><br/>
                    Enter photo <input name="photo" className="form-control" /><br/>
                    Enter food <input name="food" className="form-control" /><br/><br/>
                    Enter gender <input name="gender" className="form-control" /><br/><br/>
                    <input id="createAcc" type="submit" className="btn btn-primary" value="Create Account"/>
                </form>
                </div>
            </body>
        </html>);
    }
}

export default Register;
